// Base API service for making HTTP requests to the backend

// Changed from absolute URL to relative path to avoid CORS issues
const API_URL = '/api';

// Types
export interface LoginRequest {
  name: string;
  password: string;
}

export interface RegisterRequest {
  name: string;
  password: string;
  role: string;
  district?: string;
}

export interface AuthResponse {
  token: string;
  user: {
    id: string;
    name: string;
    role: string;
    district?: string;
  };
}

// API request helper with auth token handling
const apiRequest = async (endpoint: string, options: RequestInit = {}) => {
  const token = localStorage.getItem('token');

  const headers = {
    'Content-Type': 'application/json',
    ...(token && { 'Authorization': `Bearer ${token}` }),
    ...options.headers,
  };

  const config = {
    ...options,
    headers,
  };

  try {
    console.log(`Fetching: ${API_URL}${endpoint}`);
    const response = await fetch(`${API_URL}${endpoint}`, config);

    if (!response.ok) {
      const errorData = await response.json().catch(() => ({}));
      console.error(`API Error (${response.status}):`, errorData);
      throw new Error(errorData.error || `API Error: ${response.status} ${response.statusText}`);
    }

    return response.json();
  } catch (error) {
    if (error instanceof TypeError && error.message.includes('Failed to fetch')) {
      console.error('Connection error: Could not connect to backend server');
      throw new Error('Could not connect to the server. Please check if the backend is running on port 8080.');
    }

    console.error(`Failed to fetch ${endpoint}:`, error);
    throw error;
  }
};

// Auth API
export const authAPI = {
  login: (data: LoginRequest): Promise<AuthResponse> => 
    apiRequest('/auth/login', {
      method: 'POST',
      body: JSON.stringify(data),
    }),

  register: (data: RegisterRequest): Promise<AuthResponse> => 
    apiRequest('/auth/register', {
      method: 'POST',
      body: JSON.stringify(data),
    }),
};

// Employee API
export const employeeAPI = {
  getAll: () => 
    apiRequest('/employees'),

  getById: (id: number) => 
    apiRequest(`/employees/${id}`),

  create: (employeeData: any) => 
    apiRequest('/admin/employees', {
      method: 'POST',
      body: JSON.stringify(employeeData),
    }),

  update: (id: number, employeeData: any) => 
    apiRequest(`/admin/employees/${id}`, {
      method: 'PUT',
      body: JSON.stringify(employeeData),
    }),

  updatePMS: (id: number, pmsValue: number) => 
    apiRequest(`/manager/employees/${id}/pms`, {
      method: 'PATCH',
      body: JSON.stringify({ individual_pms: pmsValue }),
    }),

  updateDistrictRec: (id: number, recValue: number) => 
    apiRequest(`/district/employees/${id}/recommendation`, {
      method: 'PATCH',
      body: JSON.stringify({ district_rec: recValue }),
    }),
};

// Job API
export const jobAPI = {
