    apiRequest('/admin/jobs'),

  getById: (id: number) => 
    apiRequest(`/admin/jobs/${id}`),

  getByType: (type: string) => 
    apiRequest(`/admin/jobs/type/${type}`),

  create: (jobData: any) => 
    apiRequest('/admin/jobs', {
      method: 'POST',
      body: JSON.stringify(jobData),
    }),

  update: (id: number, jobData: any) => 
