// Applications API
export const applicationAPI = {
  submitInternal: (applicationData: any, resume?: File) => {
    const formData = new FormData();
    if (resume) {
      formData.append('resume', resume);
    }
    formData.append('data', JSON.stringify(applicationData));

    return apiRequest('/public/apply/internal', {
      method: 'POST',
      body: formData,
      headers: {}, // Let browser set content-type with boundary
    });
  },

  submitExternal: (applicationData: any, resume?: File) => {
    const formData = new FormData();
    if (resume) {
      formData.append('resume', resume);
    }
    formData.append('data', JSON.stringify(applicationData));

    return apiRequest('/public/apply/external', {
      method: 'POST',
      body: formData,
      headers: {}, // Let browser set content-type with boundary
    });
  },

  getAllInternal: () => 
    apiRequest('/admin/applications/internal'),

  getInternalByJob: (jobId: number) => 
    apiRequest(`/admin/applications/internal/${jobId}`),

  getAllExternal: () => 
    apiRequest('/admin/applications/external'),

  getExternalByJob: (jobId: number) => 
    apiRequest(`/admin/applications/external/${jobId}`),
};

// Public API (no auth required)
export const publicAPI = {
  getJobs: () => 
    apiRequest('/public/jobs'),
};
